import './styles.css';
// import ProgressTracker from './ProgressTracker/progressTracker';
import Header from './Header/Header'; 
import Footer from './Footer/Footer';
import NavbarSidebar from './SideBar/NavbarSidebar';
// import StudentProfiles from './StudentProfiles/studentProfiles';
// import HelpRequest from './HelpRequest/helpRequest';

function TeacherBuilder() {
    return (
        <div className="project">
            <Header />
        <div className="sidebar">
            <NavbarSidebar />
        </div>
        <div className="body">
           {/* <ProgressTracker /> */}
           {/* <StudentProfiles /> */}
           {/* <HelpRequest /> */}
           
        </div>
        <div className="footer">
            <Footer/>
            </div>
            </div>
    );
}

export default TeacherBuilder;
